import axios from 'axios';
let userValue = '';
axios.defaults.baseURL = 'https://vpic.nhtsa.dot.gov/api/vehicles/DecodeVinValues/';
const getIN = (event)=>{
    userValue = event.target.value;
    console.log(userValue);
}

const sub = (event)=>{
    axios({
        method: 'get',
        url: userValue,
      })
      .then(function (response) {alert(JSON.stringify(response, '', 2))})
      .catch(err => console.error(err))
}
export {getIN, sub};
